import React, { Component } from "react";

export default class HomePage extends Component {
  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-9">
            <div
              class="title d-flex align-items-center"
              style={{
                textAlign: "left",
                color: "#D61C4E",
                fontSize: "larger",
                fontWeight: "bold",
              }}
            >
              <span class="material-symbols-outlined" style={{}}>
                star
              </span>
              <span
                style={{
                  marginLeft: "2px",
                }}
              >
                {" "}
                Danh Sách Truyện
              </span>
            </div>
            <div></div>

          </div>
          <div class="col-3"></div>
        </div>
      </div>
    );
  }
}
